import { makeStyles } from '@material-ui/core/styles';

export default makeStyles({
  tableSingle: {
    height: 0,
    paddingTop: '33.33%',
    backgroundColor: 'rgb(230, 247, 255)',
    backgroundBlendMode: 'darken',
  },
  tablerow: {
    // padding: '0 16px',
    fontSize: 20,
    color: 'red'
  },
  border: {
    border: 'solid',
  },
  fullHeightCard: {
    height: '100%',
  },
  card: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between',
    borderRadius: '15px',
    height: '100%',
    position: 'relative',
    backgroundColor: 'lightYellow'
    // color: 'red'
  },
  overlay: {
    position: 'absolute',
    top: '20px',
    left: '20px',
    color: 'white',
  },
  overlay2: {
    position: 'absolute',
    top: '20px',
    right: '20px',
    color: 'white',
  },
  grid: {
    display: 'flex',
  },
  // details: {
  //   display: 'flex',
  //   justifyContent: 'space-between',
  //   margin: '20px',
  //   fontSize: 200,
  //   color:'green'
    // padding: '0 16px',
    // fontSize: 72,
    // color: 'purple'
  // },
  details: {
    padding: '0 16px',
    fontSize: 36,
    color: 'purple'
  },
  title: {
    padding: '0 16px',
    fontSize: 72,
    color: 'purple'
  },
  messa: {
    padding: '0 16px',
    fontSize: 28,
    color: 'purple'
  },
  cardActions: {
    padding: '0 16px 8px 16px',
    display: 'flex',
    justifyContent: 'space-between',
    color: 'pink'
  },
});
